import { Box } from "@mui/material";
import React from "react";

const MyMessage = ({ message }) => {
  console.log("message", message);
  return (
    <Box
      className="message"
      float="right"
      marginLeft="18px"
      bgcolor="chats.purple"
      marginTop="16.4px"
      marginBottom="25.9px"
    >
      {message}
    </Box>
  );
};

export default MyMessage;
